import * as React from 'react';
import { styled } from '@mui/material/styles';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid';

const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: 'center',
  color: theme.palette.text.secondary,
}));

export default function FullWidthGrid() {
  return (
    <Box sx={{
      flexGrow: 1,
      backgroundColor: (theme) => theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
    }} >
      <Grid container spacing={2} elevation={0} >
        <Grid item md={12} >
          <Item sx={{backgroundColor:'yellow', height:140,}}>xs=6 md=8</Item>
        </Grid>
        <Grid item md={12} >
          <Item sx={{backgroundColor:'blue', height:100,}}>xs=6 md=8</Item>
        </Grid>
        <Grid item md={12} >
          <Item sx={{backgroundColor:'green', height:100,}}>xs=6 md=8</Item>
        </Grid>
        <Grid item xs={6} md={4}>
          <Item>xs=6 md=4</Item>
        </Grid>
        <Grid item xs={6} md={4}>
          <Item>xs=6 md=4</Item>
        </Grid>
        <Grid item >
          <Item>xs=6 md=8</Item>
        </Grid>
      </Grid>
    </Box>
  );
}
